import threeBells from "../../assets/threeBells.wav";

export const Sound = (props) => {
  const [play] = useSound(oneBell);

  const [soundEffects, setSoundEffects] = useState({
    startRoundBell: false,
    endRoundBell: false,
    PlayOneBell: function() {useSound(oneBell)},
    playThreeBells: useSound(threeBells),
  });


soundEffects.PlayOneBell()

